import React from "react";
import DeleteOutlineIcon from '@mui/icons-material/DeleteOutline';


const Note = () => {
    return(
        <>
            <div className="my_notes">
                <h1>Title</h1>
                <br/>
                <p>this is the content</p>
                <button>
                    <DeleteOutlineIcon className="deleteIcon"/>
                </button>
            </div>
        </>
    );
}

export default Note;
